  void destroy_model()
  {
    delete mkTestBench_instance;
    mkTestBench_instance = NULL;
  }
  void reset_model(bool asserted)
  {
    (mkTestBench_instance->reset_RST_N)(asserted ? (tUInt8)0u : (tUInt8)1u);
  }
  void * get_instance()
  {
    return mkTestBench_instance;
  }
  
  /* Fill in version numbers */
  void get_version(unsigned int *year,
		   unsigned int *month,
		   char const **annotation,
		   char const **build)
  {
    *year = 2011u;
    *month = 6u;
    *annotation = "D";
    *build = "24470";
  }
  
  /* Get the model creation time */
  time_t get_creation_time()
  {
    
    /* Sun Feb  9 08:56:59 UTC 2014 */
    return 1391936219llu;
  }
  
  /* Control run-time licensing */
  tUInt64 skip_license_check()
  {
    return 0llu;
  }
  
  /* State dumping function */
  void dump_state()
  {
    (mkTestBench_instance->dump_state)(0u);
  }
  
  /* VCD dumping functions */
  MOD_mkTestBench & mkTestBench_backing()
  {
    static MOD_mkTestBench *instance = NULL;
    if (instance == NULL)
    {
      vcd_set_backing_instance(true);
      instance = new MOD_mkTestBench("top", NULL);
      vcd_set_backing_instance(false);
    }
    return *instance;
  }
  void dump_VCD_defs()
  {
    (mkTestBench_instance->dump_VCD_defs)(vcd_depth);
  }
  void dump_VCD(tVCDDumpType dt)
  {
    (mkTestBench_instance->dump_VCD)(dt, vcd_depth, mkTestBench_backing());
  }
